import React from 'react';
import './index.css';
// import Todo from './components/todo';


function App() {
  return (
    <ul
      role="list"
      className="todo-list stack-large stack-exception"
      aria-labelledby="list-heading"
    >
      <Todo name='eat'/>
      <Todo name='sleep'/>
      <Todo name='repeat'/>
    </ul>
  );
}

export default App;
